import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';

import InitialPage from './components/initialPage/InitialPage'

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact>
          <InitialPage />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
